/**
 * Callback interface for receiving progress updates during fetch operations.
 * Implement this in TypeScript/Kotlin/Swift to receive real-time updates.
 */
public interface FetchProgressCallback {
    
    /**
     * Called when a single activity fetch completes.
     * - completed: Number of activities fetched so far
     * - total: Total number of activities to fetch
     */
    fun `onProgress`(`completed`: kotlin.UInt, `total`: kotlin.UInt)
    
    companion object
}



// Put the implementation in an object so we don't pollute the top-level namespace
internal object uniffiCallbackInterfaceFetchProgressCallback {
    internal object `onProgress`: UniffiCallbackInterfaceFetchProgressCallbackMethod0 {
        override fun callback(`uniffiHandle`: Long,`completed`: Int,`total`: Int,`uniffiOutReturn`: Pointer,uniffiCallStatus: UniffiRustCallStatus,) {
            val uniffiObj = FfiConverterTypeFetchProgressCallback.handleMap.get(uniffiHandle)
            val makeCall = { ->
                uniffiObj.`onProgress`(
                    FfiConverterUInt.lift(`completed`),
                    FfiConverterUInt.lift(`total`),
                )
            }
            val writeReturn = { _: Unit -> Unit }
            uniffiTraitInterfaceCall(uniffiCallStatus, makeCall, writeReturn)
        }
    }

    internal object uniffiFree: UniffiCallbackInterfaceFree {
        override fun callback(handle: Long) {
            FfiConverterTypeFetchProgressCallback.handleMap.remove(handle)
        }
    }

    internal object uniffiClone: UniffiCallbackInterfaceClone {
        override fun callback(handle: Long): Long {
            return FfiConverterTypeFetchProgressCallback.handleMap.clone(handle)
        }
    }

    internal var vtable = UniffiVTableCallbackInterfaceFetchProgressCallback.UniffiByValue(
        uniffiFree,
        uniffiClone,
        `onProgress`,
    )

    // Registers the foreign callback with the Rust side.
    // This method is generated for each callback interface.
    internal fun register(lib: UniffiLib) {
        lib.uniffi_tracematch_fn_init_callback_vtable_fetchprogresscallback(vtable)
    }
}

